import React from 'react'

const Navbar = () => {
    const hamburger = document.querySelector(".hamburger");
        const navMenu = document.querySelector(".nav-menu");

        hamburger.addEventListener("click",() => {
        hamburger.classNameList.toggle("active");
        navMenu.classNameList.toggle("active");
        })

        document.querySelectorAll(".nav-link").forEach(n => n.addEventListener("click",() =>
        {
            hamburger.classNameList.remove("active");
            navMenu.classNameList.remove("active");
        }))
  return (
    <div className="header">
       <nav className="navbar">
            <a href="#" className="nav-branding">ADID</a>

            <ul className="nav-menu">
                <li className="nav-item">
                    <a href="aboutus.html" className="nav-link">About Us</a>
                </li>
                <li className="nav-item">
                    <a href="#" className="nav-link">Features</a>
                </li>
                <li className="nav-item">
                    <a href="aboutus.html" className="nav-link">Contact Us</a>
                </li>
            </ul>
            <div className="hamburger">
                <span className="bar"></span>
                <span className="bar"></span>
                <span className="bar"></span>
            </div>
        </nav>
    </div>
  )
}

export default Navbar
